  //   {
  //     this.setState({loading: false}); 
  //   }

  //   console.log(this.state.shops)
  // }

  render()
  {
    return (
      <div>
        <Navstuff />
        <div className='card-container'>
        <Shops shops={this.state.shops}></Shops>
        </div>

      </div>
    );
  }
}


export default App;
